def discretize_sequence_equal_width(seq, bins=2):
    # 计算数据范围并进行等宽分箱
    return pd.cut(seq, bins=bins, labels=False)



def extract_x_angle(coord_string):
    # 去掉括号，按逗号分割
    x, y, z = map(float, coord_string.strip("()").split(", "))

    # 计算水平角度（以直视前方为 0°，向右为正，向左为负）
    angle_rad = math.atan2(x, z)
    angle_deg = math.degrees(angle_rad)
    return angle_deg
